import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import AboutUs from './components/AboutUs/AboutUs';

function App() {
  return (
    <div className='App-wrapper'>
      <Header/>
      <Navbar/>
      <div className='App-wrapper-content'>
        <AboutUs/>
      </div>
    </div>
  );
}

export default App;
